}
body {

    padding: 0;
}
#wrapper {
    width:100%;
    margin: 0;
    padding: 0;
}
.container {
    margin: auto;
    max-width: 932px;
}
.row {
    overflow: hidden;
}
.row div {
    width: 50%;
    float:left;
    display: block;
}
.row img {
    float: left;
    max-width: 5%;
    height: auto;
}

.centered {
    height: 30px;
    width:100%;
    margin:auto;
    text-align: center;
}


</style>
<script src="/assets/js/jquery-1.8.2.min.js"></script>
<script>

var beforeLoad = 0;
var loadTimes = 0;
var ctr = 0;
function imageLoadHttp() {
   if (beforeLoad != 0) {
      loadTimes = new Date().getTime();
      ctr++;
   }
}


var completedLoad;

var intervalFct;
var processFunc = function() {
    if (beforeLoad != 0) {
      completedLoad.html("Loading time : " + ((loadTimes-beforeLoad)/1000.0).toFixed(3) + " seconds");
      if (ctr >= 281) {
        clearInterval(intervalFct);
      }
    }
}

</script>

    for( var i=0; i < 45; i++ )

}
